   "source": [
    "# Grouped Boxplot\n",
    "\n",
    "# Box plots of Youtube channel, subs, likes, and comments\n",
    "library(reshape)\n",
    "bplot <- melt(data = data, measure.vars = c(7,8,9,10), variable_name = \"variable\")\n",
    "\n",
    "ggplot(bplot, aes(x = variable, y = value, fill = \"ytc_name\")) +\n",
