    "# Data partition: randomly split the data set into a train (80%) and a test set (20%)\n",
    "index <- 1:nrow(data)\n",
    "set.seed(123)\n",
    "train_index <- sample(index, round(length(index)*0.8))\n",
    "train_set <- data[train_index,]\n",
    "test_set <- data[-train_index,]\n",
    "\n",
