    "# GBM model prediction\n",
    "test1 <- test_set[,-16]\n",
    "test2 <- test_set[,16]\n",
    "gbm_pred <- predict.gbm(gbm_model, test_set)\n",
    "\n",
    "\n",
    "gbm_result <- postResample(gbm_pred, test_set$downloads)\n",
    "plot(test_set$downloads ~ gbm_pred)\n",
    "\n",
    "gbm_result"
   ]
